import { StyleSheet, View } from 'react-native'

export default function App() {
    return <View style={styles.container}></View>
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#000000',
        alignItems: 'center',
        justifyContent: 'center',
    },
})
